                        onChange={formik.handleChange} max="10">

                      </input>
                    </div>

                    <button
                      type="submit"
                      className="btn btn-primary  mt-4">
                      Submit</button>
                  </Form>
                </div>
              )}
            </Formik>
          </div>
        </div>
      </div>
    );
